import React, { useState } from 'react';
import { Camera, Clock, Archive, ChevronLeft, ChevronRight } from 'lucide-react';
import { Card, CardContent, CardHeader, CardTitle } from '@/components/ui/card';
import { Button } from '@/components/ui/button';

const ConstructionDashboard = () => {
  const [activeSection, setActiveSection] = useState('live');
  const [isSidebarOpen, setIsSidebarOpen] = useState(true);

  const sections = [
    { id: 'live', name: 'Live Camera', icon: Camera },
    { id: 'timelapse', name: 'Timelapse', icon: Clock },
    { id: 'archive', name: 'Footage Archive', icon: Archive },
  ];

  const renderContent = () => {
    switch (activeSection) {
      case 'live':
        return (
          <Card>
            <CardHeader className="bg-blue-100">
              <CardTitle>Live Camera Feed</CardTitle>
            </CardHeader>
            <CardContent>
              <iframe 
                width="100%" 
                height="600" 
                src="//www.teleport.io/player?playmode=livetimelapse" 
                frameBorder="0" 
                allowFullScreen
                title="Live Camera Feed"
              ></iframe>
            </CardContent>
          </Card>
        );
      case 'timelapse':
        return (
          <Card>
            <CardHeader className="bg-blue-100">
              <CardTitle>Construction Progress Timelapse</CardTitle>
            </CardHeader>
            <CardContent>
              <div className="aspect-video bg-gray-200 flex items-center justify-center h-[600px]">
                <Clock size={48} className="text-blue-500" />
                <p className="ml-2 text-blue-700">Timelapse player would go here</p>
              </div>
            </CardContent>
          </Card>
        );
      case 'archive':
        return (
          <Card>
            <CardHeader className="bg-blue-100">
              <CardTitle>Footage Archive</CardTitle>
            </CardHeader>
            <CardContent>
              <div className="aspect-video bg-gray-200 flex items-center justify-center h-[600px]">
                <Archive size={48} className="text-blue-500" />
                <p className="ml-2 text-blue-700">Footage archive browser would go here</p>
              </div>
            </CardContent>
          </Card>
        );
      default:
        return null;
    }
  };

  return (
    <div className="flex h-screen bg-blue-50">
      <div 
        className={`bg-white shadow-md transition-all duration-300 ease-in-out relative ${
          isSidebarOpen ? 'w-64' : 'w-20'
        }`}
      >
        <Button
          variant="ghost"
          size="icon"
          className="absolute top-4 right-4 z-10"
          onClick={() => setIsSidebarOpen(!isSidebarOpen)}
        >
          {isSidebarOpen ? <ChevronLeft className="text-blue-500" /> : <ChevronRight className="text-blue-500" />}
        </Button>
        <div className="p-4 mt-14">
          <h1 className={`text-2xl font-bold mb-6 whitespace-nowrap overflow-hidden transition-all duration-300 text-blue-700 ${
            isSidebarOpen ? 'opacity-100' : 'opacity-0'
          }`}>
            Construction Dashboard
          </h1>
          <nav>
            {sections.map((section) => (
              <Button
                key={section.id}
                variant={activeSection === section.id ? "default" : "ghost"}
                className={`w-full justify-start mb-2 ${
                  isSidebarOpen ? '' : 'px-0 justify-center'
                } ${activeSection === section.id ? 'bg-blue-100 text-blue-700' : 'text-blue-500 hover:text-blue-700 hover:bg-blue-50'}`}
                onClick={() => setActiveSection(section.id)}
              >
                <section.icon className={`h-4 w-4 ${isSidebarOpen ? 'mr-2' : ''}`} />
                <span className={`transition-all duration-300 ${
                  isSidebarOpen ? 'opacity-100' : 'opacity-0 w-0 overflow-hidden'
                }`}>
                  {section.name}
                </span>
              </Button>
            ))}
          </nav>
        </div>
      </div>

      <div className="flex-1 p-4 overflow-auto">
        {renderContent()}
      </div>
    </div>
  );
};

export default ConstructionDashboard;
